\"content\";s:769:\"Cut down unwanted spam registrations by requiring your users to activate their account by clicking a link sent to their email address. Take it a step further and require admin approval before allowing users access to your site. Double the protection by requiring both.\r\n<h5>Features</h5>\r\n<ul>\r\n 	<li>Require new users to confirm their email address in order to activate their account</li>\r\n 	<li>Administrators can resend activation emails to remind users to activate their account</li>\r\n 	<li>Users can request to resend their activation email if they attempt to login while pending activation</li>\r\n 	<li>Require new users to be approved by an administrator</li>\r\n 	<li>Require new users to confirm their email address and be approved by an administrator</li>\r\n</ul>\";s:7:\"excerpt\";s:69:\"Require users to confirm their email address or be manually approved.\";s:9:\"thumbnail\";s:63:\"https://cdn.thememylogin.com/uploads/edd/2018/05/moderation.png\";s:8:\"category\";b:0;s:4:\"tags\";a:1:{i:0;O:8:\"stdClass\":10:{s:7:\"term_id\";i:7;s:4:\"name\";s:6:\"legacy\";s:4:\"slug\";s:6:\"legacy\";s:10:\"term_group\";i:0;s:16:\"term_taxonomy_id\";i:7;s:8:\"taxonomy\";s:12:\"download_tag\";s:11:\"description\";s:0:\"\";s:6:\"parent\";i:0;s:5:\"count\";i:6;s:6:\"filter\";s:3:\"raw\";}}}s:7:\"pricing\";O:8:\"stdClass\":3:{s:10:\"singlesite\";s:5:\"10.00\";s:8:\"2-5sites\";s:5:\"25.00\";s:14:\"unlimitedsites\";s:5:\"40.00\";}s:9:\"licensing\";O:8:\"stdClass\":4:{s:7:\"enabled\";b:1;s:7:\"version\";s:3:\"1.1\";s:8:\"exp_unit\";s:5:\"years\";s:10:\"exp_length\";s:1:\"1\";}}i:8;O:8:\"stdClass\":3:{s:4:\"info\";O:8:\"stdClass\":12:{s:2:\"id\";i:55;s:4:\"slug\";s:8:\"security\";s:5:\"title\";s:8:\"Security\";s:11:\"create_date\";s:19:\"2018-05-28 01:31:46\";s:13:\"modified_date\";s:19:\"2020-11-12 00:49:10\";s:6:\"status\";s:7:\"publish\";s:4:\"link\";s:45:\"https://thememylogin.com/extensions/security/\";s:7:\"content\";s:518:\"Help secure your website by throttling and blocking IP addresses after a predetermined amount of failed login attempts.\r\n<h5>Features</h5>\r\n<ul>\r\n 	<li>Set the number of failed attempts required for lockout</li>\r\n 	<li>Set the period of time the failed attempts must span to be locked out</li>\r\n 	<li>Set the duration of the lockout</li>\r\n 	<li>Automatically lockout invalid usernames</li>\r\n 	<li>Manually lock and unlock specific users</li>\r\n 	<li>Disable wp-login.php</li>\r\n 	<li>Enforce strong passwords</li>\r\n</ul>\";s:7:\"excerpt\";s:53:\"Help secure your website with brute force protection.\";s:9:\"thumbnail\";s:61:\"https://cdn.thememylogin.com/uploads/edd/2018/05/security.png\";s:8:\"category\";b:0;s:4:\"tags\";a:1:{i:0;O:8:\"stdClass\":10:{s:7:\"term_id\";i:7;s:4:\"name\";s:6:\"legacy\";s:4:\"slug\";s:6:\"legacy\";s:10:\"term_group\";i:0;s:16:\"term_taxonomy_id\";i:7;s:8:\"taxonomy\";s:12:\"download_tag\";s:11:\"description\";s:0:\"\";s:6:\"parent\";i:0;s:5:\"count\";i:6;s:6:\"filter\";s:3:\"raw\";}}}s:7:\"pricing\";O:8:\"stdClass\":3:{s:10:\"singlesite\";s:5:\"10.00\";s:8:\"2-5sites\";s:5:\"25.00\";s:14:\"unlimitedsites\";s:5:\"40.00\";}s:9:\"licensing\";O:8:\"stdClass\":4:{s:7:\"enabled\";b:1;s:7:\"version\";s:5:\"1.1.3\";s:8:\"exp_unit\";s:5:\"years\";s:10:\"exp_length\";s:1:\"1\";}}i:9;O:8:\"stdClass\":3:{s:4:\"info\";O:8:\"stdClass\":12:{s:2:\"id\";i:52;s:4:\"slug\";s:11:\"redirection\";s:5:\"title\";s:11:\"Redirection\";s:11:\"create_date\";s:19:\"2018-05-28 01:29:28\";s:13:\"modified_date\";s:19:\"2020-11-12 00:48:33\";s:6:\"status\";s:7:\"publish\";s:4:\"link\";s:48:\"https://thememylogin.com/extensions/redirection/\";s:7:\"content\";s:487:\"Don\'t want your users being redirected to the Dashboard upon login? Want to redirect them back where they came from instead? Want to send Subscribers to one place and Authors to another? You need the Redirection extension.\r\n<h5>Features</h5>\r\n<ul>\r\n 	<li>Specify where users are redirected upon login</li>\r\n 	<li>Specify where users are redirected upon logout</li>\r\n 	<li>Specify where users are redirected upon registration</li>\r\n 	<li>Manage redirection rules per user role</li>\r\n</ul>\";s:7:\"excerpt\";s:57:\"Redirect users upon login and logout based on their role.\";s:9:\"thumbnail\";s:64:\"https://cdn.thememylogin.com/uploads/edd/2018/05/redirection.png\";s:8:\"category\";b:0;s:4:\"tags\";a:1:{i:0;O:8:\"stdClass\":10:{s:7:\"term_id\";i:7;s:4:\"name\";s:6:\"legacy\";s:4:\"slug\";s:6:\"legacy\";s:10:\"term_group\";i:0;s:16:\"term_taxonomy_id\";i:7;s:8:\"taxonomy\";s:12:\"download_tag\";s:11:\"description\";s:0:\"\";s:6:\"parent\";i:0;s:5:\"count\";i:6;s:6:\"filter\";s:3:\"raw\";}}}s:7:\"pricing\";O:8:\"stdClass\":3:{s:10:\"singlesite\";s:5:\"10.00\";s:8:\"2-5sites\";s:5:\"25.00\";s:14:\"unlimitedsites\";s:5:\"40.00\";}s:9:\"licensing\";O:8:\"stdClass\":4:{s:7:\"enabled\";b:1;s:7:\"version\";s:3:\"1.1\";s:8:\"exp_unit\";s:5:\"years\";s:10:\"exp_length\";s:1:\"1\";}}i:10;O:8:\"stdClass\":3:{s:4:\"info\";O:8:\"stdClass\":12:{s:2:\"id\";i:49;s:4:\"slug\";s:9:\"recaptcha\";s:5:\"title\";s:9:\"reCAPTCHA\";s:11:\"create_date\";s:19:\"2018-05-28 01:27:10\";s:13:\"modified_date\";s:19:\"2020-11-12 00:47:48\";s:6:\"status\";s:7:\"publish\";s:4:\"link\";s:46:\"https://thememylogin.com/extensions/recaptcha/\";s:7:\"content\";s:464:\"Keep spam bots at bay by utilizing Google reCAPTCHA on your registration and login forms.\r\n<h5>Features</h5>\r\n<ul>\r\n 	<li>Require reCAPTCHA on your registration form</li>\r\n 	<li>Require reCAPTCHA on your login form</li>\r\n 	<li>Require reCAPTCHA on your lost password form</li>\r\n 	<li>Require reCAPTCHA on your comment form</li>\r\n 	<li>Choose your reCAPTCHA theme</li>\r\n 	<li>reCAPTCHA will be localized if the translation exists for the selected locale</li>\r\n</ul>\";s:7:\"excerpt\";s:69:\"Enable Google reCAPTCHA support on your registration and login forms.\";s:9:\"thumbnail\";s:62:\"https://cdn.thememylogin.com/uploads/edd/2018/05/recaptcha